// SPDX-License-Identifier: SEE LICENSE IN LICENSE
pragma solidity ^0.8.28;


/**
 * @notice Escrow Contract
 * @dev Manages job funds held during project execution
 */

contract Escrow{
    enum Status { Pending, Completed, Disputed, Released }

    struct Job {
        address client;
        address freelancer;
        uint256 amount;
        uint256 deadline;
        Status status;
    }

    uint256 public jobCounter;
    mapping(uint256 => Job) public jobs;

    // events
    event JobCreated(uint256 indexed jobId, address client, address freelancer, uint256 amount);
    event JobCompleted(uint256 indexed jobId);
    event JobDisputed(uint256 indexed jobId);
    event FundsReleased(uint256 indexed jobId);


    // functions
    function createJob(address _freelancer, uint256 _deadline) external payable{
        require(msg.value > 0, "Must fund escrow");

        jobCounter += 1;
        jobs[jobCounter] = Job({
            client: msg.sender,
            freelancer: _freelancer,
            amount: msg.value,
            deadline: block.timestamp + _deadline,
            status: Status.Pending
        });

        emit JobCreated(jobCounter, msg.sender, _freelancer, msg.value);
    }

    function completeJob(uint256 _jobId) external {
        Job storage job = jobs[_jobId];
        require(msg.sender == job.client, "Only client can confirm completion");
        require(job.status == Status.Pending , "Job not in pending state");

        job.status = Status.Completed;
        emit JobCompleted(_jobId);
    }

    function disputeJob(uint256 _jobId) external {
        Job storage job = jobs[_jobId];
        require(msg.sender == job.freelancer, "Only freelancer can dispute");
        require(job.status == Status.Pending, "Job not disputable");

        job.status = Status.Disputed;
        emit JobDisputed(_jobId);
    }

    function releaseFunds(uint256 _jobId) external {
        Job storage job = jobs[_jobId];
        require(job.status == Status.Completed || block.timestamp > job.deadline, "Cannot release funds yet");

        job.status = Status.Released;
        payable(job.freelancer).transfer(job.amount);

        emit FundsReleased(_jobId);
    }

}

contracts/LearningModule.sol.content:
// SPDX-License-Identifier: SEE LICENSE IN LICENSE
pragma solidity ^0.8.28;


/**
 * @notice Learning Module Contract
 * @dev Tracks course enrollments and completions
 */
contract LearningModule {
    struct Course {
        string title;
        string uri;
    }

    mapping(uint256 => Course) public courses;
    mapping(address => mapping(uint256 => bool)) public completed;
    uint256 public courseCounter;

    event CourseCreated(uint256 indexed id, string title, string uri);
    event CourseCompleted(address indexed user, uint256 indexed id);

    function createCourse(string memory _title, string memory _uri) external {
        courseCounter++;
        courses[courseCounter] = Course(_title, _uri);
        emit CourseCreated(courseCounter, _title, _uri);
    }

    function completeCourse(uint256 _id) external {
        require(!completed[msg.sender][_id], "Already completed");
        completed[msg.sender][_id] = true;
        emit CourseCompleted(msg.sender, _id);
    }

    function hasCompleted(address _user, uint256 _id) external view returns (bool) {
        return completed[_user][_id];
    }
}

